import urllib.request
import json

import time

VADR_URL = "http://13.56.20.142:5001/vadr/"
VADR_PASSWORD = "maurovadraws"

class MicroVaderConnect:

    def __init__(self, sequence_name, sequence):
        self.sequence_name = sequence_name
        self.sequence =  sequence
        self.job_id = None
        self.results = {}

    def submit_sequence(self):
        request_payload = {
            "sequence_name": str(self.sequence_name),
            "sequence": str(self.sequence),
            "password": VADR_PASSWORD
        }
        data = json.dumps(request_payload).encode("utf-8")
        headers = {
            "Content-Type": "application/json",
            "Accept": "application/json",
        }
        try:
            req = urllib.request.Request(VADR_URL, data, headers)
            with urllib.request.urlopen(req) as f:
                res = f.read()
            response_json = json.loads(res.decode())
            self.job_id = response_json["process_id"]
        except Exception as e:
            print(e)

    def get_results(self):
        try:
            req = urllib.request.Request(f"{VADR_URL}{self.job_id}")
            with urllib.request.urlopen(req) as f:
                res = f.read()
            response_json = json.loads(res.decode())
            self.results = response_json.get("results", {})
            return response_json
        except Exception as e:
            print(e)

if __name__ == "__main__":
    mvc = MicroVaderConnect(
        "NC_045512.2",
        ""
    )
    mvc.submit_sequence()
    print(f"job id: {mvc.job_id}")
    while mvc.results == None:
        mvc.get_results()
        time.sleep(5)
    print(mvc.results["VADR_status"])
